INSERT INTO "Listings" ("IsActive", "ListingType", "Name", "Description", "Address", "Website", "PhoneNumber", "CreatedDate", "UpdatedDate", "Latitude", "Longitude") VALUES ('True', 'shopping', 'Pet Food Warehouse', 'We are more of a department store for your pet than just a pet store. You will find more than 55 different brands of dog/cat foods and the most wonderful variety of treats. We also have a huge toy selection for dogs, cats, birds and small animals. In our tropical fish room you will find more than 60 tanks of fish as well as a full line of aquariums. Please come visit us and explore the vast variety of wonderful products we have to offer! And, if you can not find what you are looking for, we are HAPPY to place special orders!','1830 61st Ave N, Saint Petersburg, FL 33714', 'https://www.petfoodstpete.com/pet-food-warehouse/','(727) 521-6191', '2021-10-01', '2021-10-01', 27.827637, -82.651544);
INSERT INTO "Listings" ("IsActive", "ListingType", "Name", "Description", "Address", "Website", "PhoneNumber", "CreatedDate", "UpdatedDate", "Latitude", "Longitude") VALUES ('True', 'libations', 'Dog Bar', 'The Dog Bar is a combination of a private off leash dog park and a full service sports bar. Watch your dog play while you enjoy your favorite beverage! Located in the Grand Central District of St. Pete, this unique spot offers a hybrid between a private dog park and a full liquor, beer, and wine bar. Our unique concept is all about the dogs and we require our doggie patrons to have a membership, this helps us ensure that all of our pups are healthy and nonaggressive.','2300 Central Avenue, Saint Petersburg, FL 33712', 'https://www.dogbarstpete.com','(727) 317-4968', '2021-10-04', '2021-10-04', 27.770697, -82.664725);
INSERT INTO "Listings" ("IsActive", "ListingType", "Name", "Description", "Address", "Website", "PhoneNumber", "CreatedDate", "UpdatedDate", "Latitude", "Longitude") VALUES ('True', 'vacation', 'Casa del Merman', 'Casa del Merman at GayStPete House has 6 guest rooms with unique characteristics. Each room is named after a local beach, and the decor is definitely Florida. All rooms have private entrance, private bath and TV with DVD players. Take advantage of our weekly special to unwind or explore the area, pay for 5 nights, stay for 7. Free WIFI covers the entire property.','4505 5th Avenue North, St Petersburg, FL 33713', 'https://www.gaystpetehouse.com','(727) 365-0544', '2021-10-04', '2021-10-04', 27.777339, -82.693963);
INSERT INTO "Listings" ("IsActive", "ListingType", "Name", "Description", "Address", "Website", "PhoneNumber", "CreatedDate", "UpdatedDate", "Latitude", "Longitude") VALUES ('True', 'adoptions', 'Pet Pal', 'Our mission is to rescue dogs and cats from shelters that may otherwise be euthanized due to time limitations, illness, injuries or lack of socialization and training. We are dedicated to educating the public about the pet overpopulation crisis, the importance of spaying/neutering and responsible pet ownership.','405 22nd Street North, St Petersburg, FL 33712', 'https://petpalanimalshelter.com/','(727) 328-7738', '2021-10-04', '2021-10-04', 27.775858, -82.663182);